script: |
  super -f text -I q1415.spq | sort > q1415.out

inputs:
  - name: q1415.spq
    data: |
      SELECT 73 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 * 5 NOT BETWEEN - col2 * - col1 + + 60 / + col0 + - col2 AND NULL;
  - name: tab1

outputs:
  - name: q1415.out
    data: |
      73
      73
      73
